={{ 
(() => {
  const amount = parseFloat($json.amount);
  const raw_base = amount / 1.02;
  let earnings = (Number.isInteger(raw_base) && raw_base > 250) 
    ? parseFloat((raw_base * 0.02).toFixed(2)) 
    : amount * 0.02;

  earnings = Math.ceil(earnings);
  return earnings < 5 ? 5 : earnings;
})()
}}

={{ 
(() => {
  const amount = parseFloat($json.amount);

  if (amount % 5 === 0) {
    const earnings = amount * 0.02;
    return Math.max(Math.trunc(earnings * 100) / 100, 5);
  }

  const pre_total = amount + 5;
  const rem = pre_total % 5;
  const adjust = rem === 0 ? 0 : 5 - rem;
  const next_multiple = pre_total + adjust;
  const earnings = next_multiple - amount;

  return Math.max(Math.trunc(earnings * 100) / 100, 5);
})()
}}
